  \"2016-05-31T01:05:58.481693\",\n\t\"name\": \"afsc-race-sap-cummiskey-red-king-crab-sonic-tagging-and-dive-database\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This is data from a long-term monitoring
  project which utilized sonic tags to follow aggregations of red king crab in Womens
  Bay near Kodiak Alaska. The database consists of four major tables:  Sonic tags:
  An inventory of all tags used recording crab size and sex dates of tag release and
  recovery, and if possible the reason for tag loss. Locations: Field locations in
  latitude, longitude, and depth for sonic tags, generally acquired on a weekly basis.
  Dive summary:A summary of dive observations on sonic tagged crab aggregations to
  document crab behavior and habitat use. Crab measurements:Measurements of crab carapace
  lengths, sex, and shell conditions of diver-collected crab from crab aggregations
  associated with tagged crab.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
